class Skein512_384CoreTest : Skein512_384Test() {
    override fun digest(): Digest<*> = CoreDigest.create(Algorithm.Skein512_384)

    @Test
    fun hasImplementation() {
        assertNotNull(digest())
    }
}

// No built-in support
class Skein512_384InstalledProviderTest {

    @BeforeTest
    fun beforeTest() {
        installPlatformProvider()
    }

    @AfterTest
    fun afterTest() {
        removePlatformProvider()
    }

    @Test
    fun noImplementation() {
        assertNull(PlatformDigest().create(Algorithm.Skein512_384))
    }
}

/**
 * Test Skein-512-384 implementation.
 */
abstract class Skein512_384Test {

    abstract fun digest(): Digest<*>

    // From https://github.com/bcgit/bc-java/blob/master/core/src/test/java/org/bouncycastle/crypto/test/SkeinDigestTest.java
    @Test
    fun bouncy() {
        testKatHex(
            digest(),
            "fbd17c26b61a82e12e125f0d459b96c91ab4837dff22b39b78439430cdfc5dc8" +
                    "78bb393a1a5f79bef30995a85a12923339ba8ab7d8fc6dc5fec6f4ed22c122bb" +
                    "e7eb61981892966de5cef576f71fc7a80d14dab2d0c03940b95b9fb3a727c66a" +
                    "6e1ff0dc311b9aa21a3054484802154c1826c2a27a0914152aeb76f1168d4410",
            "825f5cbd5da8807a7b4d3e7bd9cd089ca3a256bcc064cd73a9355bf3ae67f2bf" +
                    "93ac7074b3b19907a0665ba3a878b262"
        )
    }

    // From specification - skein_golden_kat.txt
    @Test
    fun zero() {
        testKat(
            digest(),
            ByteArray(128),
            "E63EA4698F314AD9F8F8CBD1F336E027" +
                    "955F8DCE78C3210AF9B1F46BD328367D" +
                    "8E88D431071C4385CD8B50D74862C248"
        )
    }

